        .pgs-tooltip__content {

            background: var(--TooltipBackgroundColor);

            padding: 8px 16px;
            box-shadow: var(--TooltipBoxShadow);
            border-radius: var(--TooltipBorderRadius);
            width: max-content;
            max-width: 50vw;

        .pgs-tooltip__content:before {
            content: "";

            display: block;
            height: 8px;
            width: 8px;
            transform: rotate(45deg);
            background: inherit;

        .pgs-tooltip--dark .pgs-tooltip__content {

            border: var(--TooltipErrorBorderColor);
            box-shadow: var(--TooltipErrorBoxShadow);
        }

        .pgs-tooltip--top .pgs-tooltip__content {
            left: 50%;
            bottom: calc(100% + 8px);
            transform: translate(-50%, 0);

            left: calc(50% - 4px);
            bottom: -4px;

        .pgs-tooltip--left .pgs-tooltip__content:before {

            right: calc(100% + 8px);

        #my-subscription #manage-subscription-button-label {

        #my-subscription .subscription-info {

            grid-gap: 24px;
            gap: 24px;
            flex-wrap: wrap;
        }

        #my-subscription .subscription-info .pgs-card {
            margin: 0;
        }

        #my-subscription .subscription-expiry {
            display: flex;
            flex-direction: column;
            flex-grow: 1;
            padding: 24px;

            flex-grow: 1;
            padding: 24px;
            overflow: auto;
        }

        #my-subscription .subscription-details>div:nth-child(1) {
            padding-bottom: 12px;

            height: 370px;
            overflow: auto;
        }

        #my-subscription #subscription-props>div {
            display: flex;
            align-items: center;
            min-height: 65px;
            border-top: 1px solid #dedbdb;
        }

        #my-subscription #subscription-props>div:last-child {
            border-bottom: 1px solid #dedbdb;
        }

        #my-subscription #subscription-props>div> :nth-child(1) {
            width: 30%;
            overflow: hidden;
            text-overflow: ellipsis;
        }

        #my-subscription #subscription-props>div> :nth-child(2) {
            max-width: 70%;
            overflow: hidden;
            white-space: nowrap;

        #my-subscription #subscription-props>div> :nth-child(2):hover {
            max-width: none;
            white-space: normal;
            text-overflow: clip;
            overflow: visible;
        }

        #my-subscription #go-to-my-account {
            padding-top: 24px;

    <style>
        #action-center {
            z-index: 1;
            position: relative;
            display: flex;
            align-items: center;
            justify-content: center;
            min-height: 220px;
            flex-direction: column;
        }

        #action-center .ac-slide {
            display: flex;
            height: 100%;
            width: 100%;
        }

        #action-center #action-center-carousel {
            display: flex;
            flex-direction: row;
            max-width: 125px;
            margin-inline-start: auto;
            width: 100%;
            justify-content: space-between;
            position: absolute;
            inset-inline-end: 20px;
            bottom: 5px;
        }

        #action-center #action-center-carousel #action-center-carousel-up,
        #action-center #action-center-carousel #action-center-carousel-down {
            padding: 0;
            background-color: transparent;
            border: none;
            cursor: pointer;
        }

        #action-center #action-center-carousel #action-center-carousel-index {
            display: flex;
            align-items: center;
        }

        #action-center #action-center-carousel #action-center-carousel-up,
        #action-center #action-center-carousel #action-center-carousel-down {
            transform: rotate(-90deg);
        }

        [dir=rtl] #action-center #action-center-carousel #action-center-carousel-up,
        [dir=rtl] #action-center #action-center-carousel #action-center-carousel-down {
            transform: rotate(90deg);
        }

        #action-center .ac-slide-frame {
            width: 100%;
            height: 224px;
            margin-top: 0;
            overflow: inherit;
            justify-content: center;
            align-items: center;
        }

        #action-center .ac-left-col {
            min-width: 237px;
        }

        #action-center .ac-left-col svg {
            width: 180px !important;
            height: 180px !important;
        }

        #action-center .ac-left-col+div {
            flex-grow: 1;
        }

        #action-center .loader_animation {
            width: 100%;
            animation: loader_animation_frames 4s infinite;
        }

        #action-center .ac-success-background_updated {
            width: 100%;
            height: 100%;
            min-height: 216px;
        }

        #action-center .ac-waves {
            background-image: url(/static/media/ac_feedback.41ed9841.svg);
            background-repeat: no-repeat;
            background-position: left bottom;
        }

        #action-center .ac-all-safe {
            content: url(/static/media/action-center_success_computer-safe.1517a6da.svg);
        }

        #action-center .ac-all-safe-bg {
            width: 100%;
            height: 100%;
        }

        #action-center .ac-update-issue {
            content: url(/static/media/action-center_danger_out-of-date.acfd616c.svg);
        }

        #action-center .icon-ac-image {
            width: 100%;
            height: 100%;
            background-position: center;
        }

        #action-center .icon-ac-virus-found-danger {
            background-image: url(/static/media/action-center_danger_virus-found.42241c24.svg);
        }

        #action-center .web-advisor-image-dimension {
            width: 162.2px;
        }

        #action-center .ac-card-button-cont ainer button {
            font-size: inherit !important;
        }

        #action-center .dss-illustration {
            width: 220px;
        }

        #action-center .oem-acc {
            width: 100%;
            height: 100%;
        }

        #action-center .oem-acc> :nth-child(1) {
            z-index: 1;
        }

        #action-center .oem-acc .header {
            color: var(--grayscale-800-gray, #454545);
            font-size: 32px;
            line-height: 40px;
            font-weight: 500;
        }

        #action-center .oem-acc .sub-header {
            color: var(--grayscale-800-gray, #454545);
            font-size: 28px;
            line-height: 40px;
            font-weight: 300;
            text-align: center;
        }

        #action-center .oem-acc .body {
            color: var(--grayscale-800-gray, #454545);
            /* Body/B3 */
            font-size: 16px;
            font-style: normal;
            font-weight: 400;
            line-height: 24px;
            /* 150% */
            padding-bottom: 12px;
        }

        #action-center .oem-acc button {
            min-width: 110px !important;
        }

        #action-center .oem-acc .overlap-container {
            min-width: 220px;
            min-height: 300px;
            display: flex;
            flex-direction: column;
            justify-content: flex-end !important;
            align-items: flex-end !important;
        }

        #action-center .oem-acc .overlap-container svg {
            opacity: 0.7;
            position: absolute;
        }

        #action-center .button-background-danger {
            background: #c01818 !important;
            border: unset !important;
        }

        #action-center .accard-background-red {
            background: #fef6f6 !important;
        }

        .ux2 #action-center {
            min-height: 324px;
        }

        .ux2 #action-center .ac-slide {
            background-color: #f0f3ff;
        }

        .ux2 #action-center .ac-slide-frame {
            border-radius: unset;
            border: unset;
            box-shadow: unset;
            height: -moz-fit-content;
            height: fit-content;
        }

        .ux2 #action-center #ac-loader-container {
            background-color: white;
        }

        .ux2 #action-center .pgs-card {
            width: 100%;
            height: 100%;
        }

        .ux2 #action-center .font-weight-500 {
            font-weight: 500 !important;
        }

        .ux2 #action-center .font-weight-275 {
            font-weight: 275 !important;
        }

        .ux2 #action-center .font-weight-300 {
            font-weight: 300 !important;
        }

        .ux2 #action-center .normal-font-weight {
            font-weight: 400 !important;
        }

        @media screen and (max-width: 1024px) {
            .ux2 #action-center .oem-acc {
                width: 100%;
            }

            #action-center .ac-slide-frame .ac-left-col {
                display: none !important;
            }

            #action-center .loader_animation {
                width: calc(100% - 32px);
            }
        }

        @media screen and (max-width: 768px) {
            #action-center {
                flex-wrap: wrap;
                justify-content: center;
            }

            .ux2 #action-center .overlap-container {
                display: none !important;
            }

            .ux2 #action-center .max-width-340 {
                max-width: 600px !important;
            }

            #action-center .oem-acc {
                max-width: 100% !important;
                max-height: 100% !important;
            }

            .action-center-home {
                flex-direction: column;
                justify-content: center;
            }

            .action-center-home .ac-left-col {
                margin: auto;
            }

            .text-overflow-common {
                display: block;
            }

            .pgs-tooltip__content {
                display: none;
            }

            #action-center-carousel {
                flex-direction: row !important;
                margin-inline-start: unset !important;
                bottom: auto !important;
            }

            #action-center-carousel #action-center-carousel-index {
                flex-grow: initial !important;
                min-width: 90px;
                justify-content: center;
            }
        }

        @media screen and (max-width: 600px) {
            #action-center .overlap-container {
                display: none !important;
            }

            #action-center .ac-card-button-container {
                flex-direction: column;
            }

            #action-center .ac-card-button-container button {
                font-size: 14px !important;
            }

            #action-center .ac-all-safe {
                display: none !important;
            }

            .ux2 #action-center {
                width: 100%;
            }

            .ux2 #action-center .ac-slide-frame {
                overflow: visible;
            }
        }

    <style>
        #dashboard {
            padding: 0 24px;
        }

        #dashboard #dashboard-tiles {
            min-height: 342px;
        }

        #dashboard.ux2 {
            padding: 0;
        }

        #dashboard.ux2 #dashboard-tiles {
            min-height: unset;
        }

        #dashboard.ux2 #dashboard-tiles #dashboard-tiles-row {
            flex-wrap: nowrap;
            padding: 24px 12px;
        }

        #dashboard #dashboard-banner {
            display: flex;
            flex-direction: row;
            background: white;
            height: max-content;
            min-height: 324px;
        }

        #dashboard #dashboard-banner #action-center {
            width: 670px;
            max-width: unset;
            flex-grow: 1;
        }

        #dashboard #dashboard-banner #action-center .pgs-card {
            background-color: transparent;
        }

        #dashboard #dashboard-banner #action-center #ac-loader-container {
            min-height: 250px;
        }

        #dashboard #dashboard-banner #value-box {
            height: auto;
            width: 340px;
            box-sizing: border-box;
            min-width: unset;
            flex-grow: 0;
        }

        #dashboard #dss-home-panel {
            padding-bottom: 16px;
        }

        #dashboard #dashboard-tiles-row {
            grid-gap: 16px;
            gap: 16px;
            padding: 24px 0;
        }

        #dashboard .dashboard-tile {
            position: relative;
            display: flex;
            flex-grow: 1;
            width: 290px;
        }

        #dashboard .dashboard-tile .pgs-card {
            width: 100%;
            margin-top: 0;
        }

        #dashboard .dashboard-tile .pgs-card.uxv2-card-primary {
            width: 272px;
        }

        #dashboard .dashboard-tile .pgs-card .pgs-tag {
            height: auto;
        }

        @media screen and (max-width: 1035px) {
            #dashboard .dashboard-tile {
                max-width: none;
            }

            #dashboard .dashboard-tile .pgs-card.uxv2-card-primary {
                width: 100%;
            }
        }

        @media screen and (max-width: 1024px) {
            #dashboard.ux2 {
                padding: 0;
            }

            #dashboard.ux2 #dashboard-tiles #dashboard-tiles-row {
                flex-wrap: wrap;
            }

            #dashboard #dashboard-banner {
                height: -moz-fit-content;
                height: fit-content;
                flex-wrap: wrap;
            }
        }

        @media screen and (max-width: 690px) {
            #dashboard.ux2 #dashboard-banner {
                display: flex;
                flex-direction: row;
                background: white;
                height: max-content;
                min-height: 350px;
            }

            #dashboard.ux2 #dashboard-banner #action-center {
                width: unset;

    <style>
        .partner-logo-img {
            vertical-align: middle;
            background-size: contain;
            display: inline-block;
            height: 80%;
            margin: 10px;
        }

        #HeaderRightSideTags .partner-logo-img {
            height: 30px;
            width: 100px;
        }

        #HeaderView header {
            background-color: var(--SecondaryBackgroundColor);
            color: #333333;
            outline: none;
            box-shadow: 0px 0px 8px rgba(33, 41, 52, 0.12), 0px 0 2px rgba(0, 0, 0, 0.08);
            background-repeat: no-repeat !important;
        }

        #HeaderView header #HeaderContent {
            height: 57px;
        }

        .core-header {
            font-size: 18px;
            padding-inline-start: 12px;
            padding-inline-end: 100px;
            display: flex;
            justify-content: space-between;
            height: 100%;
        }

        .core-header .right-side-tags {
            display: flex;
            align-items: center;
        }

        .core-header .header-main-title {
            position: relative;
            display: flex;
            align-items: center;
            padding-inline-start: 120px;
            color: #c01818;
            font-weight: bold;
        }

        .core-header .header-main-title:before {
            font-family: "icons";
            font-weight: normal;
            position: absolute;
            inset-inline-start: 0;
            content: "\e946";
            font-size: 22px;
        }

        .core-header .header-main-title .package-name {
            border-inline-start: solid #c01818 1px;
            padding-inline-start: 10px;
        }

        .core-header .trial-tag {
            font-size: 13px;
            padding: 0 12px;
            margin: 0 10px;
            border-radius: 6px;
            cursor: pointer;
            border: none;
            background-color: #f2f2f2;
        }

        .core-header .partner-logo {
            padding: 0 10px;
        }

        .core-header .partner-logo-text {
            margin-top: 17px;
        }

        .core-header .partner-logo img {
            vertical-align: middle;
            max-height: 40px;
        }

        .core-header .partner-text {
            font-size: 0.722em;
            position: relative;
        }

        .core-header .partner-logo+.trial-tag {
            margin: -6px 31px 0;
        }

        .gen_tooltip {
            font-size: 0.75em;
            position: absolute;
            color: #788890;
            display: table;
            z-index: 99;
            cursor: pointer;
            background: #fff;
            border: 1px solid #c9cdf9;
            border-radius: 5px;
            box-shadow: 0 2px 6px 0 rgba(0, 0, 0, 0.1);
            transition: opacity 180ms cubic-bezier(0.02, 0.01, 0.47, 1);
            opacity: 0;
            transform: translate(-50%, 0);
        }

        .gen_tooltip:before {
            content: "";
            display: block;
            position: absolute;
            top: 100%;
            right: 50%;
            z-index: 1;
            width: 12px;
            height: 12px;
            margin-right: -6px;
            margin-top: -6px;
            background: #f4f5fe;
            box-shadow: inherit;
            border-collapse: separate;
            transform: rotate(45deg);
            border-top-left-radius: 15px;
            border: 1px solid #c9cdf9;
        }

        .gen_tooltip:after {
            content: " ";
            display: block;
            position: absolute;
            top: 100%;
            right: 50%;
            z-index: 2;
            width: 20px;
            height: 10px;
            margin-right: -10px;
            margin-top: -10px;
            background: #f4f5fe;
        }

        .gen_tooltip.tooltip_top {
            top: inherit;
            bottom: calc(100% + 8px);
        }

        .gen_tooltip.tooltip_bottom {
            top: calc(100% + 8px);
            bottom: inherit;
        }

        .gen_tooltip.tooltip_bottom:before {
            transform: rotate(225deg);
            box-shadow: 1px 1px 1px 0 rgba(0, 0, 0, 0.2);
            top: auto;
        }

        .gen_tooltip .tooltip_icon {
            position: absolute;
            font-family: "icons";
            text-align: center;
            margin: 0;
            left: 10px !important;
            top: 10px !important;
            font-size: 10px;
        }

        .gen_tooltip .tooltip_icon:before {
            content: "";
            display: block;
            width: 25px;
            height: 25px;
            text-shadow: none;
        }

        .gen_tooltip .tooltip_icon:after {
            font-size: 1.2em;
            color: #fff;
            position: absolute;
            top: 8px;
            left: 10.5px;
        }

        .gen_tooltip .tooltip_content {
            padding: 12px 12px 12px 42px;
            display: block;
        }

        [dir=rtl] .gen_tooltip .tooltip_icon {
            right: 10px;
        }

        [dir=rtl] .gen_tooltip .tooltip_content {
            padding: 12px 42px 12px 12px;
        }

        #header-account-menu .signedIn {
            border-radius: 20px;
            color: white !important;
        }

        .signedInColor {
            background: #4258ff;
        }

        .header-bar-menu-container {
            padding: 24px 0 !important;
        }

        .header-bar-submenu-title {
            margin-left: -8px;
        }

        #header-account-menu-panel {
            position: absolute;
            right: -97px;
        }

        [dir=rtl] #header-account-menu-panel {
            position: absolute;
            left: -100px;
            top: 59px;
        }

        .header-bar-menu-item {
            padding: 12px 24px 12px 24px !important;
        }

        .title-bar-menu-item-label {
            font-size: 16px;
            font-weight: 400;
            line-height: 24px;
        }

        .title-bar-menu-group-header-label {
            font-size: 16px;
            font-weight: 600;
            line-height: 24px;
        }

        #btn-header-account-menu {
            height: 48px;
        }

        #value-box .pgs-tooltip__content {
            max-width: 160px;
        }

        #HeaderRightSideTags {
            align-self: flex-start;
            position: relative;
            height: 100%;
        }

        #HeaderRightSideTags .trial-tag {
            min-height: 30px;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        #HeaderRightSideTags .gen_tooltip {
            padding: 10px;
            width: 240px;
            top: 100%;
            opacity: 1;
            font-size: 12px;
            text-align: center;
            z-index: 1001;
            left: 50%;
            background-color: #f4f5fe;
        }

        #HeaderRightSideTags .gen_tooltip:before {
            top: 0;
            transform: rotate(225deg);
        }

        #HeaderRightSideTags .gen_tooltip:after {
            top: 10px;
        }

        #HeaderRightSideTags .gen_tooltip .tooltip_content {
            padding: 0;
            color: #9daacc;
            font-size: 10px;
        }

        @media screen and (max-width: 857px) {
            #header-account-text {
                display: none !important;
            }

            #HeaderRightSideTags {
                display: none !important;
            }
        }

        @media screen and (max-width: 480px) {
            .package-name {
                display: none !important;
            }

    <style>
        body {
            margin: 0;
            -webkit-font-smoothing: antialiased;
            -moz-osx-font-smoothing: grayscale;
            overflow: hidden;
            background: #f2f2f2;
            cursor: default;
            -webkit-user-select: none;
            user-select: none;
        }

        .popupBackground {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background-color: rgba(0, 0, 0, 0.6);
            z-index: 10000;
            display: flex;
            flex-direction: column;
            align-content: center;
            justify-content: center;
            align-items: center;
        }

        .popupBackground .reactPopup {
            background-color: white;
            padding: 2em;
            border-radius: 0.5em;
            font-size: 3em;
        }

        #WindowControls {
            position: fixed;
            top: 8px;
            right: 6px;
            display: flex;
            align-items: center;
            justify-content: space-between;
            height: 40px;
            width: 85px;
            z-index: 20000;
        }

        #WindowControls button {
            width: 40px;
            border-radius: 6px;
        }

        #WindowControls button:hover {
            color: var(--ButtonHoverTextColor);
            background: var(--ButtonHoverBackgroundColor);
        }

        #App,
        #HeaderView {
            display: block;
        }

        #SideNavbar {
            width: 40px;
            min-width: 40px;
        }

        #AppContent {
            height: calc(100vh - 60px);
            overflow-y: overlay;
            overflow-x: hidden;
            flex-grow: 1;
            position: relative;
            background-color: #f2f2f2;
            display: flex;
            flex-direction: column;
            justify-content: flex-start;
            align-items: center;
        }

        #AppContent>* {
            max-width: 1010px;
            width: 100%;
            box-sizing: border-box;
        }

        #AppContent #RouteContent {
            height: calc(100vh - 114px);
            overflow: visible;
        }

        .z-index-1 {
            z-index: 1;
        }

        .nav-manu-icon {
            width: 24px;
            height: 23.75px;
            margin-right: 8px !important;
        }

        .card-disabled {
            box-shadow: 0px -1px 2px rgba(55, 124, 251, 0.08), 0px 2px 4px rgba(55, 124, 251, 0.12) !important;
            border-radius: 12px;
        }

        .title-section {
            box-shadow: var(--CardBoxShadow) !important;
        }

        [disabled] button {
            opacity: 0.6;
            filter: grayscale(100%);
            pointer-events: none;
            cursor: not-allowed;
        }

        [action-center] {
            height: 220px;
            padding-bottom: 24px;
        }

        #App {
            height: 740px;
        }

        #AppBody {
            display: flex;
            position: fixed;
            left: 0;
            top: 60px;
            width: 100%;
            height: calc(100vh - 60px);
            background-color: #f2f2f2;
        }

        .fullScreen {
            position: fixed;
            left: 0;
            top: 0;
            width: 100%;
            height: 100vh;
            background-color: #f2f2f2;
        }

        /* Custom Scroll bars */
        ::-webkit-scrollbar {
            width: 12px !important;
            height: 12px !important;
        }

        ::-webkit-scrollbar-thumb {
            background: #b8b2b2;
            background-clip: padding-box;
            border-color: transparent;
            border-width: 8px 0 0 8px;
            border-style: solid;
        }

        [dir=rtl] ::-webkit-scrollbar-thumb {
            border-width: 8px 8px 0 0;
        }

        ::-webkit-scrollbar-thumb:hover {
            border-radius: 6px;
            background-clip: initial;
        }

        ::-webkit-scrollbar-track {
            background: transparent;
        }

        .text-overflow-common {
            display: -webkit-box;
            -webkit-box-orient: vertical;
            overflow: hidden;
        }

        .text-overflow-lines-1 {
            -webkit-line-clamp: 1;
        }

        .text-overflow-lines-2 {
            -webkit-line-clamp: 2;
        }

        .text-overflow-lines-3 {
            -webkit-line-clamp: 3;
        }

        .text-overflow-lines-4 {
            -webkit-line-clamp: 4;
        }

        .app-tooltip {
            font-size: 16px !important;
            font-weight: normal !important;
            display: block;
            -webkit-line-clamp: initial;
            white-space: break-spaces;
        }

        .hide-tooltip>*,
        .hide-tooltip>*>* {
            cursor: default !important;
        }

        .hide-tooltip .pgs-tooltip-enter-done {
            display: none;
        }

        .gap-12 {
            grid-gap: 12px;
            gap: 12px;
        }

        [dir=rtl] #WindowControls {
            left: 6px;
            right: auto;
        }

        [dir=rtl] i[role=presentation]:not([ltr], .icon-Asm-CheckmarkCircleOutline) {
            transform: scaleX(-1);
            display: inline-block;
        }

        [dir=rtl] svg:not([ltr], .pgs-checkbox__checkmark > *) {
            transform: scaleX(-1);
        }

        [dir=rtl] .pgs-modal__close {
            right: auto;
            left: 8px;
        }

        .pgs-input .pgs-input__container .pgs-input__counter {
            padding-inline-start: 12px;
        }

        .pgs-checkbox .pgs-checkbox__label:not(:empty) {
            margin-inline-start: 10px;
        }

        .overflow-y-scroll {
            overflow-y: scroll !important;
            overflow-x: hidden !important;
        }

        .full-width {
            width: 100% !important;
        }

        @keyframes loader_animation_frames {
            0% {
                opacity: 0.3;
            }

            25% {
                opacity: 1;
            }

            50% {
                opacity: 0.3;
            }

            75% {
                opacity: 1;
            }

            100% {
                opacity: 0.3;
            }
        }

        .w-650 {
            width: 100%;
            max-width: 650px;
        }

        .full-parent-area {
            position: absolute;
            left: 0;
            right: 0;
            top: 0;
            bottom: 0;
        }

        #AppSnackbar {
            position: fixed;
            top: 65px;
            right: 0;
            z-index: 9999;
        }

        [dir=rtl] #AppSnackbar {
            left: 0;
            right: auto;
        }

        /*added as a temporary css since pegasus 4.1.0 didnot hide logo*/
        .pgs-drawer__logo {
            display: none;
        }

        @keyframes from-left {
            0% {
                left: -300px;
            }
        }

        @keyframes from-right {
            0% {
                right: -300px;
            }
        }

        .setting-header:focus-visible {
            outline-style: solid;
            outline-width: 2px;
        }

        .grid-container {
            width: 100% !important;
        }

        .position-loader {
            position: absolute;
            left: 50%;
            top: 50%;
            transform: translate(-50%, -50%);
        }

        .position-loader>div {
            top: 50%;
            position: relative;
            transform: translate(0, -50%);
        }

        @media screen and (max-width: 768px) {
            .pa-24-xs {
                padding: 24px !important;
            }

            .py-24-xs {
                padding-top: 24px !important;
                padding-bottom: 24px !important;
            }

            .justify-content-start-xs {
                justify-content: start !important;
            }
        }

        @media screen and (max-width: 690px) {
            .w-98-xs {
                width: 98% !important;
            }

            .wrap-wrap-xs {
                flex-wrap: wrap !important;
            }

            .wrap-inherit-xs {
                flex-wrap: inherit;
            }
        }

        @media (forced-colors: active) {

            .pgs-icon,
            .pgs-icon:hover {
                color: CanvasText !important;
            }

            .core-header .header-main-title {
                color: CanvasText !important;

                                                                        class="pgs-button pgs-button--tertiary pgs-button--sm pgs-button__width--normal pgs-button__shape--pill set-focus justify-content-start text-info position-arrow-left"
                                                                        id="mqc_see_details_click"
                                                                        aria-label="Tracker Remover"
                                                                        data-autom-id="mqc_see_details_click"><i
                                                                            class="pgs-icon icon pgs-icon--md text-info ml-4"
                                                                            role="presentation" data-autom-id="mqc_icon"
                                                                            aria-hidden="true">-&gt;</i></button>
                                                                </div>

                                    </div>

                        </div>
                    </div>
                </div>
            </div>
            <div id="PageIFrameCache" data-autom-id="PageIFrameCache"></div>
        </div>
    </div>

    <script>
        window.addEventListener("DOMContentLoaded", () => {
            let showMoreInfo = false;
            const toggleMoreInfo = () => {
                showMoreInfo = !showMoreInfo;
                let moreInfo
                if (showMoreInfo) {
                    moreInfo = document.createElement("div");
                    moreInfo.setAttribute("id", "more-info");
                    moreInfo.innerHTML = `<div role="dialog" aria-label="scan see details" class="px-8 py-12 position-absolute fadeIn action-card-more-info popup-root tile-more-info" style="background-color: lightyellow; border-radius: 15px; box-shadow: rgb(170, 170, 170) 3px 3px 8px; bottom: 20px; width: 280px; right: 40px; z-index: 2; transition-duration: 1s;"><div class="flex align-items-center" style="height: 30px;"><div class="pgs-subHeading pgs-subHeading--md grow-1 px-8" data-autom-id="scan_see_details_title" id="scan_see_details_title">Antivirus</div><button id="close-popup" class="pgs-button pgs-button--tertiary pgs-button--md pgs-button__width--normal pgs-button__shape--pill set-focus" aria-label="Close" data-autom-id="scan_see_details_close" style="width: 42px; color: black;"><i class="pgs-icon icon pgs-icon--md" role="presentation" aria-hidden="true">X</i></button></div><div class="pgs-paragraph pgs-paragraph--sm my-8 px-8" id="scan_see_details_desc" data-autom-id="scan_see_details_desc">Scans your PC for threats</div><div><button class="pgs-button pgs-button--tertiary pgs-button--sm pgs-button__width--normal pgs-button__shape--pill set-focus justify-content-start text-info " id="scan_see_details_more_info_click" data-autom-id="scan_see_details_more_info_click" style="width: 100%;"><i class="pgs-icon icon pgs-icon--md ml-4" role="presentation" data-autom-id="scan_see_details_icon" aria-hidden="true">-&gt;</i><span class="flex align-items-center"><div class="pgs-label pgs-label--sm text-info">See details</div></span></button></div></div>`
                    document.getElementById("av-more-info").parentElement.appendChild(moreInfo);
                    const close = document.getElementById("close-popup");
                    close.focus();
                    close.addEventListener("click", toggleMoreInfo)
                }else{
                    moreInfo = document.getElementById("more-info");
                    moreInfo.parentElement.removeChild(moreInfo);
                    document.getElementById("av-more-info").focus();
                }
            }
            document.getElementById("av-more-info").addEventListener("click", toggleMoreInfo);
        })
    </script>
</body>
